import { Delimiter, DropDown, Helpers, PageMain, SimpleGrid } from "core";
import React, { Component } from "react";
import constants from "../../utils/constants";
import NotificationSystem from "react-notification-system";
import Button from "../../componet/button";
import { reportTypeOption } from "../../utils/selectOptionsUtils";

export default class FIUCodingReportListPage extends Component {
  constructor(props) {
    super(props);
    this.state = { isLoading: false, updateKey: 1, headers: [] };
    this.pageInfo = {
      title: "گزارش کدینگ FIU",
      icon: "list-search",
    };
    this.notificationSystem = React.createRef();
  }

  onSearch = () => {
    var reportTypeId = this.state.reportTypeId;
    if (reportTypeId == null || reportTypeId == "") {
      Helpers.DisplayErrorMessage(
        this.notificationSystem,
        null,
        "نوع گزارش را وارد نمایید"
      );
      return false;
    }
    Helpers.DisplayWarningMessage(
      this.notificationSystem,
      null,
      "این فرم در حال پیاده سازی می باشد"
    );
  };

  onRemoveFilter = () => {
    this.state.headers = [];
    this.setState({
      reportTypeId: null,
      updateKey: this.state.updateKey + 1,
    });
  };

  onReportTypeSelected = (item) => {
    console.log("item", item);
    console.log("item.value", item.value);
    switch (item.value) {
      case 1:
        this.state.headers = [
          { title: "نوع کارت", name: "role7" },
          { title: "کد نوع کارت", name: "role8" },
        ];
        break;

      case 2:
        this.state.headers = [
          { title: "نوع ارز", name: "currencyType" },
          { title: "کد ارز", name: "role8" },
        ];
        break;
      case 3:
        this.state.headers = [
          { title: "شرح", name: "role7" },
          { title: "کد مشخصه ATM", name: "role8" },
        ];
        break;
      case 4:
        this.state.headers = [
          { title: "نام شغل", name: "jobName" },
          { title: "کد شغل", name: "jobId" },
        ];
        break;

      case 5:
        this.state.headers = [
          { title: "شرح وضعیت حساب", name: "accountStatusName" },
          { title: "کد وضعیت حساب", name: "depositeStatus" },
        ];
        break;

      case 6:
        this.state.headers = [
          { title: "شرح نوع مشتری", name: "customerTypeName" },
          { title: "نوع مشتری", name: "customerType" },
        ];
        break;

      case 7:
        this.state.headers = [
          { title: "نام حساب", name: "role9" },
          { title: "کد حساب", name: "provinceName" },
        ];
        break;

      case 8:
        this.state.headers = [
          { title: "نام کشور", name: "provinceCode" },
          { title: "شناسه", name: "role3" },
        ];
        break;

      case 9:
        this.state.headers = [
          { title: "کد وضعیت", name: "isActive" },
          { title: "نام شهر", name: "cityName" },
          { title: "کد شهر", name: "cityCode" },
        ];
        break;

      case 10:
        this.state.headers = [
          { title: "وضعیت سطح تحصیلات", name: "role10" },
          { title: "شناسه سطح تحصیلات", name: "role9" },
        ];
        break;

      case 11:
        this.state.headers = [
          { title: "نام استان", name: "provinceName" },
          { title: "کد استان", name: "provinceCode" },
        ];
        break;

      case 12:
        this.state.headers = [
          { title: "شرح", name: "role3" },
          { title: "کد", name: "role4" },
        ];
        break;

      case 13:
        this.state.headers = [
          { title: "شرح فروشنده", name: "role5" },
          { title: "کد فروشنده", name: "role6" },
        ];
        break;

      case 14:
        this.state.headers = [
          { title: "نام شغل", name: "jobName" },
          { title: "شناسه", name: "jobId" },
        ];
        break;
    }
  };

  render() {
    return (
      <>
        <PageMain
          title={this.pageInfo.title}
          icon={this.pageInfo.icon}
          isLoading={this.state.isLoading}
          footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
          key={this.state.updateKey}
        >
          <DropDown
            context={this}
            mdCol={4}
            lgCol={4}
            name="reportTypeId"
            title="نوع گزارش"
            options={reportTypeOption()}
            required
            changeHandler={(e) => this.onReportTypeSelected(e)}
          />
          <div className="text-start col-lg-4 col mt-2 me-4">
            <Button
              buttonClass={`btn btn-outline-primary mx-1 mt-2  mb-3`}
              text="جستجو"
              onclick={() => this.onSearch()}
            />
            <Button
              buttonClass={`btn btn-outline-danger col-lg-1.5 mx-4 mt-2  mb-3`}
              text="حذف فیلتر"
              onclick={() => this.onRemoveFilter()}
            />
            <Button
              buttonClass={`btn btn-outline-success col-lg-1.5 mt-2 mb-3 `}
              text="خروجی اکسل"
              // onclick={() => this.onRemoveFilter()}
            />
          </div>
          <SimpleGrid
            context={this}
            minHeightTableWrapper={constants.MinGridHeight}
            filterBgColor="primary"
            name="fiuList"
            title="گزارش کدینگ FIU"
            listApiUrl="/api/amls/bi/Receive_STR_/SearchPersonReceive_STR"
            // extraItemsSentToFetchData={{
            //   reportTypeId: this.state.eportTypeId,
            // }}
            headers={this.state.headers}
            enableAutoFetch
            filterOptions={null}
            notificationSystem={this.notificationSystem}
          />
        </PageMain>
        <NotificationSystem ref={this.notificationSystem} />
      </>
    );
  }
}
